import java.util.Scanner; class Main { public static void main(String args[]) { String a,b; Scanner sc= new Scanner (System.in); a = sc.nextLine(); b = sc.nextLine(); StringBuilder se = new StringBuilder(a); StringBuilder sk = new StringBuilder(b); int i,j; for(i=0;i<se.length();i++) { for(j=0;j<sk.length();j++) { if(se.charAt(i)== sk.charAt(j)) { se.setCharAt(i,'&'); } } } for(i=0;i<se.length();i++) { if(se.charAt(i)!='&') { System.out.print((char)se.charAt(i)); } } } }